CREATE TABLE `livros` (
  `id` int(11) NOT NULL auto_increment,
  `identificacao_id` int(11) default NULL,
  `area_id` int(11) default NULL,
  `editora_id` int(11) default NULL,
  `localizacao_id` int(11) default NULL,
  `tombo_seduc` int(11) default '0',
  `tombo_l` varchar(255) collate utf8_unicode_ci default NULL,
  `colecao` varchar(255) collate utf8_unicode_ci default NULL,
  `edicao` varchar(255) collate utf8_unicode_ci default NULL,
  `data_edicao` date default NULL,
  `local_edicao` varchar(255) collate utf8_unicode_ci default NULL,
  `resumo` text collate utf8_unicode_ci,
  `obs` text collate utf8_unicode_ci,
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `status` tinyint(1) default '1',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1085 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
SET character_set_client = @saved_cs_client;

